import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
  BarChart,
  Bar,
} from "recharts";

const userGrowthData = [
  { month: "Jan", users: 40 },
  { month: "Feb", users: 80 },
  { month: "Mar", users: 65 },
  { month: "Apr", users: 120 },
  { month: "May", users: 150 },
];

const activityData = [
  { name: "Uploads", value: 120 },
  { name: "Downloads", value: 95 },
  { name: "Logins", value: 200 },
  { name: "Errors", value: 15 },
];

const GlassCard = ({ title, children }) => {
  return (
    <div className="glass-card">
      <h2>{title}</h2>
      <div>{children}</div>
    </div>
  );
};

export default function AdminDashboard() {
  return (
    <div className="container">
      {/* Embedded CSS */}
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Montserrat:wght@600;700&display=swap');
        body {
          margin:0; padding:0; font-family: 'Segoe UI', sans-serif;
          background: linear-gradient(to bottom, #0f0c29, #302b63, #24243e);
          color: #f0f0f0;
        }
        .container {
          min-height: 100vh; padding: 40px; background: none;
        }
        h1 { font-family:'Montserrat', sans-serif; font-size:36px; color:#fff; margin-bottom:30px; text-align:center; }
        .glass-card {
          background: rgba(255,255,255,0.1); backdrop-filter: blur(10px);
          border-radius:16px; padding:20px; margin-bottom:30px;
          border:1px solid rgba(255,255,255,0.2); color:#fff;
          box-shadow:0 8px 32px rgba(0,0,0,0.25);
        }
        .glass-card h2 { font-size:20px; margin-bottom:15px; }
        table { width:100%; border-collapse:collapse; color:#fff; }
        th, td { padding:12px; border-bottom:1px solid rgba(255,255,255,0.2); text-align:left; }
        th { text-transform:uppercase; font-size:12px; }
        tbody tr:nth-child(even){ background: rgba(255,255,255,0.05);}
        tbody tr:hover{ background: rgba(255,255,255,0.1);}
        @media(max-width:768px){
          .container{ padding:20px; }
        }
      `}</style>

      {/* Header */}
      <h1>Admin Dashboard</h1>

      {/* Stats Cards */}
      <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(200px,1fr))", gap: "20px", marginBottom: "30px" }}>
        <GlassCard title="Total Users"><p style={{ fontSize: "28px", fontWeight: "bold" }}>120</p></GlassCard>
        <GlassCard title="Activity Logs"><p style={{ fontSize: "28px", fontWeight: "bold" }}>523</p></GlassCard>
        <GlassCard title="Total Uploads"><p style={{ fontSize: "28px", fontWeight: "bold" }}>78</p></GlassCard>
      </div>

      {/* Charts */}
      <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(300px,1fr))", gap: "20px", marginBottom: "30px" }}>
        <GlassCard title="User Growth">
          <ResponsiveContainer width="100%" height={250}>
            <LineChart data={userGrowthData}>
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.2)" />
              <XAxis dataKey="month" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip contentStyle={{ backgroundColor:"rgba(0,0,0,0.8)", borderRadius:"8px", border:"none", color:"#fff" }} />
              <Line type="monotone" dataKey="users" stroke="#82ca9d" strokeWidth={3} />
            </LineChart>
          </ResponsiveContainer>
        </GlassCard>

        <GlassCard title="Activity Breakdown">
          <ResponsiveContainer width="100%" height={250}>
            <BarChart data={activityData}>
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.2)" />
              <XAxis dataKey="name" stroke="#fff" />
              <YAxis stroke="#fff" />
              <Tooltip contentStyle={{ backgroundColor:"rgba(0,0,0,0.8)", borderRadius:"8px", border:"none", color:"#fff" }} />
              <Bar dataKey="value" fill="#8884d8" radius={[8,8,0,0]} />
            </BarChart>
          </ResponsiveContainer>
        </GlassCard>
      </div>

      {/* Recent Logs Table */}
      <GlassCard title="Recent Logs">
        <div style={{ overflowX:"auto" }}>
          <table>
            <thead>
              <tr>
                <th>Timestamp</th>
                <th>User</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              <tr><td>2025-08-17 10:15</td><td>John Doe</td><td>Uploaded PDF</td></tr>
              <tr><td>2025-08-17 09:50</td><td>Jane Smith</td><td>Login</td></tr>
              <tr><td>2025-08-17 09:30</td><td>Admin</td><td>Reviewed Logs</td></tr>
            </tbody>
          </table>
        </div>
      </GlassCard>
    </div>
  );
}
